struct node* delete(struct node* head, int solution_number){
	struct node* cursor = head;
	struct node* pre_cursor = head;
	if (head->solution_number == solution_number){
		while (pre_cursor->next != head){
			pre_cursor = pre_cursor->next;
		}
		printf("Pre cursor is pointing to: %d\n", pre_cursor->solution_number);
		pre_cursor->next = head->next;
		printf("Next to Pre cursor is pointing to: %d\n", pre_cursor->next->solution_number);
		
		head = NULL;
		free(head);
		printf("Deleted solution_number: %d\n", solution_number);
		return pre_cursor->next;
	}

	cursor = cursor->next;
	while (cursor != head){
		if (cursor->solution_number == solution_number){
			while (pre_cursor->next != cursor){
				pre_cursor = pre_cursor->next;
			}
			pre_cursor->next = cursor->next;
			free(cursor);
			cursor = NULL;
			printf("Deleted solution_number: %d\n", solution_number);
			return head;
		}
		cursor = cursor->next;
	}
	printf("solution_number %d not found. Unable to delete!\n", solution_number);
	return head;
}

